import React, {Component} from 'react';
import './App.css';
import Form from './components/Form'

class App extends Component {
  render(){
    return (
    <div className="App">
      <input type='search' 
                       placeholder='SEARCH TV-GUIDE!!!'
                       onChange={e => this.setState({searchField: e.target.value})} 
                       />
      <Form />
    </div>
  );

}
}

export default App
